import react from "react";
import Home from "./pages/Home/Home";
import { BrowserRoute as Router, Routes, Route } from "react-router-dom";

const App = () => {
  return (
    <Router>
      <Routes>
        <Route to="/details" element={
            <div>
            <Home />
          </div>
        }>
        </Route>
      </Routes>
    </Router>
  );
};

export default App;
